function set_slider_val(weight,id){
    let name = "checkbox" + id;
    let slider_name = "slider" + id;
    let checkbox = document.getElementById(name);
    if (checkbox.checked) {
        weight = document.getElementById(slider_name).value;
    }
    else {
        weight = 0;
    }
    return weight
}

